import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import CreateNote from "./CreateNote";
import Note from "./Note";

const App = () => {

    const addNote = () => {
        alert(heyyyy);
    }
    return(
    <>
       <Header />
       <Footer />
       <CreateNote 
           passNote = {addNote}
       />
       <Note />
    </>
    );
}

export default App;
